import React, { useContext } from 'react';
import {
    ContainerProfile,
    Date,
    ContainerTitle,
    Hellow,
    Strong,
    ContainerBetween,
    Photo,
    ButtonOpenDrawer
} from './styles'

import { TouchableOpacity } from 'react-native'
import { EvilIcons } from '@expo/vector-icons';
import { AuthContext } from '../../context/AuthContext'
import { firebase } from '../../service/FirebaseDB'

type Props = {
    date: string;
    hellow: string;
    strong: string;
    photo?: string;
    onPress: () => void;
}

export function Profile({ date, hellow, onPress, photo, }: Props) {

    const {user} = useContext(AuthContext)
    return (
        <ContainerProfile>
            <Date>{date}</Date>
            <ContainerBetween>
                <ContainerTitle>
                    <Hellow>{hellow}</Hellow>
                        <Strong>{user?.name}</Strong>
                </ContainerTitle>
                {/* {<Photo></Photo>} */}
                <ButtonOpenDrawer onPress={onPress}>
                    <EvilIcons name="navicon" size={28} color="black" />
                </ButtonOpenDrawer>
            </ContainerBetween>
        </ContainerProfile>
    )
}
